import React from 'react';
import './index.css';

function Card(props){
    return(
        <div className="card">
        <a href="#" target="_blank" className="card_btn">
        <div className="cards">
            <img src={props.isc} alt="mypic" className="card_img"/>
            <div className="card__info">
                <h3 className="card_titel">{props.titel}</h3>
                <span className="card_txt">{props.txt}</span>
                <button className="btn">Read More</button>
            </div>
        </div>
        </a>
    </div>
    )
}

export default Card;
